import {useNavigation} from 'react-router-dom';

function IsUserAuthenticated(user) {
    const navigation = useNavigation();

    if(!user){
        return  (redirectUrl = '/login') => navigation.navigate(redirectUrl);
    }
}

export default IsUserAuthenticated;
